import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import {BrowerRouter} from 'react-router-dom';
import App from './App';

ReactDOM.render(
    <BrowerRouter>
        <App />
    </BrowerRouter>,
    document.getElementById('root'));
